function App() {
  return (
    <div className="App">
      <h1>hello world</h1>
    </div>
  );
}
function NavBar() {
  return (
    <nav>
      <ul>
        <li>HOME</li>
        <li>ABOUT</li>
        <li>contact</li>
      </ul>
    </nav>
  )
}

export default NavBar;
